:root {
  .vimium-reset,
  #vomnibar,
  #hud-container {
    /** Customizable Palette */
/** Customizable Palette â€” Gruvbox Light Hard */
--accent: #af3a03;
--text: #edbbb2;
--background: #504945;




    /** Calculated Palette */
    --text-secondary: color-mix(in srgb, var(--text) 60%, transparent);
    --text-tertiary: color-mix(in srgb, var(--text) 35%, transparent);
    --background-selected: color-mix(in srgb, var(--background), #000 20%);
    --border-primary: var(--background-selected);
    --box-shadow: 0 1px 3px rgb(0 0 0 / 12%), 0 1px 2px rgb(0 0 0 / 24%);
  }
}

@keyframes show {
  0% {
    transform: translateY(50px);
    opacity: 0;
  }

  100% {
    transform: translateY(0);
    opacity: 1;
  }
}

#vimium-hint-marker-container {
  .internal-vimium-hint-marker {
    padding: 3px 4px;
    background: var(--background);
    border: none;
    box-shadow: var(--box-shadow);
  }

  span {
    color: var(--text);
    text-shadow: none;
  }

  .matchingCharacter {
    opacity: 0.4;

    ~ span {
      color: var(--accent);
    }
  }
}

#vomnibar {
  background: var(--background);
  border: none;
  box-shadow: var(--box-shadow);
  animation: show 200ms cubic-bezier(0, 0, 0.2, 1) forwards;

  #vomnibar-search-area {
    padding: 10px 30px;
    color: var(--text);
    background: transparent;
    border: none;

    input {
      padding: 0;
      color: var(--text);
      background: transparent;
      box-shadow: none;
    }
  }

  ul {
    margin: 0;
    padding: 0;
    background: transparent;
    border-top: 1px solid var(--border-primary);
  }

  li {
    padding: 10px;
    border-bottom: 1px solid var(--border-primary);

    .top-half,
    .bottom-half {
      display: flex;
      padding: 3px 0;
    }

    .title,
    .source {
      color: var(--text-secondary);
    }

    .url {
      overflow: hidden;
      color: var(--text-tertiary);
      white-space: nowrap;
      text-overflow: ellipsis;
    }

    .match {
      color: var(--accent);
      font-weight: normal;
    }

    .title .match {
      color: var(--accent);
    }

    &.selected {
      background-color: var(--background-selected);
      border-bottom: 1px solid transparent;
    }
  }
}

#hud-container {
  background: var(--background);
  border: none;
  box-shadow: var(--box-shadow);

  #hud.hud-find {
      display: flex;
  }

  span#hud-find-input {
    position: relative;
    width: 100%;

    &::before {
      position: sticky;
      left: 0;
      padding-right: 4px;
      color: var(--text-secondary);
      background: linear-gradient(
        90deg,
        var(--background) 0%,
        var(--background) 50%,
        transparent 100%
      );
    }
  }

  span#hud-find-input,
  #hud {
    color: var(--text-secondary);
  }

  #hud-match-count {
    flex-shrink: 0;
    float: none;
    padding-left: 4px;
  }

  #hud.hud-find,
  #search-area {
    background-color: transparent;
    border: none;
  }
}
